import * as React from 'react';

function Card({ item, handleSelectedCards, toggled }) { 
    return ( 
        <div className="item"> 
            <div className={toggled ? "toggled" : ""}> 
                <img className="face" src={item.img} alt="face" /> 
                <div 
                    className="back"
                    onClick={() => handleSelectedCards(item)} 
                > 
                    {" "} 
                </div> 
            </div> 
        </div> 
    ); 
} 

export default Card;
